1:46 PM; Case called for Plea/sentencing hearing.  Defendant Kayla M Gibas appeared by Zoom video, in custody at MHOC.  Attorney Eryn M Menden in court for Kayla M Gibas.  Prosecuting attorney Peter Michael Tempelis in court for the State of Wisconsin. All parties have agreed that some may have the hearing conducted remotely. This hearing has met the statutory standards for video conferencing.  Court notes it has received a plea questionnaire and reviews the offer as listed in the document.  State and Defense confirm the offer.  Court conducts plea colloquy with the defendant.  Defendant enters a guilty plea to Counts 1 & 2, Court finds defendant guilty of Counts 1 & 2.  Court orders Counts 3 dismissed and read in.

Sentencing arguments made by the State.
Sentencing arguments made by Atty. Menden.
Defendant presents statements.

COUNT 1: 
The Court Orders the Following:

Imposed and Stayed Sentence of:

1 Year Jail Straight Time (concurrent to sentence in Count 2 IF imposed)

Term of Probation: 1 Year & 6 Months (Court will allow transfer to Milwaukee County)

Conditions of Probation:
-	Follow through with any treatment and/or counseling recommended by Agent;
-	Follow any conditions deemed appropriate by Agent;
-	AODA Assessment and follow through with any treatment recommended;
-	Absolute Sobriety; Random U.A.'s;
-	No Use or Possession of alcohol or illegal drugs or drug paraphernalia;
-	No use or possession of any controlled substances without a valid doctor's prescription
-	Mental Health evaluation and follow through with any treatment recommended.  
-       Defendant to attend the Victim Impact Panel 

Condition Time: 120 Days Huber with release for work and treatment (108 Days Credit) - To commence forthwith.

DL REVOCATION:  27 months.
IGNITITION INTERLOCK: 27 months.

FINE:  $1,544.00 (includes IID surcharge);

DNA Surcharge: $200.00;

DNA Sample ordered and to be provided immediately if in custody or within (3) business days at the Waukesha County Sheriff Department. 

BLOOD DRAW FEE:  $35.00 to be paid through Waukesha County Circuit Court to be forwarded to City of Brookfield Police Department.

Total costs/fine/forfeiture:  to be paid as a condition of probation. Failure to pay;  will result in a civil judgment.



